import bannerImage from "../images/b1.jpg";
import "./Dashboard.css";
const Dashboard = () => {
  return (
    <div>
      <div className="row">
        <div className="col-12">
          <img className="tm-main-bg" src={bannerImage} alt="logo" />
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
